import '../App.css'
import React, { useState, useEffect } from "react"
import Table from 'react-bootstrap/Table';


const ShowSessionUser = () => {

  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(false);
  useEffect(() => {
    setLoading(true);
    fetch("http://localhost:8080/restaurant/api/v1/showAllSessionUsers/1")
      .then((response) => response.json())
      .then((json) => setData(json))
      .finally(() => {
        setLoading(false);
      });
  }, []);


  try {
    axios
      .post(`http://localhost:8080/restaurant/api/v1/showAllSessionUsers//${sessionId}`)
      .then((response) => {
        setData({
          emailAddress: response.data.emailAddress,
          firstName: response.data.restaurantAddedBy,
          lastName: response.data.sessionId,
          statusCode: response.data.statusCode
        });
        console.log(response);
        console.log(response.data);
        //Adding user to local storage
        localStorage.removeItem("restaurantFinderUserId");
        localStorage.removeItem("restaurantFinderSessionId");
      });
  } catch (error) {
    console.error("Error fetching data:", error);
    window.location = "/error"; //This line of code will redirect you once the submission is succeed
  }


  if(data.statusCode ==200) {
    return (
      <Table striped bordered hover size="sm">
        <thead>
          <tr>
          <tr>
                <th>Email Address</th>
                 <th>First Name</th>
                 <th>Last Name</th>
            </tr>
          </tr>
        </thead>
        <tbody>
            {data && data.users && data.users.map(user =>
                 <tr key={user.emailAddress}>
                 <td>{user.emailAddress}</td>
                 <td>{user.firstName}</td>
                 <td>{user.lastName}</td>
               </tr>
            )}
        </tbody>
      </Table>
    );
  } else {
    return (
      <Table striped bordered hover size="sm">
        <thead>
          <tr>
            <th>Message</th>
          </tr>
        </thead>

        <tbody>
          {
            <tr key={data.message}>
              <td>{data.message}</td>
            </tr>
          }
        </tbody>
      </Table>
    );
  }

}
export default ShowSessionUser;
